import React from "react";
import './Home.css';
import heroImg from "./../hero-img.png";

export default function Home() {
  return (
  <>
  
    <div className="hero">
        <img src={heroImg} alt="Customer" className="heroimg" />
       <div className="all-hero-text">
        <div className="herotext">
       
            <h4>Customer Relationship Management</h4>
            <h1>Build<br/>Your Loyal<br/>Customer</h1>
            <p>support a global network that includes large scale businesses in more than 100 countries to generate more leads.</p>
        </div>
        </div>
    </div>
  
  
  
  </>
  );
}
